    <div id="base" class="">

      <div id="u0" class="ax_default _默认样式">

        <div id="u0_text" class="text " style="display:none; visibility: hidden">

      <div id="u1" class="ax_default _默认样式" data-label="登录按纽" selectiongroup="按纽组-9">

        </div>

      <div id="u2" class="ax_default" data-label="输入框" data-left="399" data-top="300" data-width="300" data-height="50">

        <div id="u3" class="ax_default _默认样式" data-label="边框">
